func base64ToRaw(imageString string) image.Image {
	reader := base64.NewDecoder(base64.StdEncoding, strings.NewReader(imageString))
	// decodedImage, err := base64.StdEncoding.DecodeString(imageString)

	rawImage, _, err := image.Decode(reader)
	if err != nil {
		log.Fatal(err)
	}

	return rawImage
}

func saveToDisk(img bytes.Buffer) string {
	filename := fmt.Sprintf("%v.webp", uuid.New().String())

	err := os.WriteFile(filename, img.Bytes(), 0o644)
	if err != nil {
		log.Fatal(err)
	}
	return filename
}

func webpEncode(img image.Image) bytes.Buffer {
	var buff bytes.Buffer

	options, err := encoder.NewLossyEncoderOptions(encoder.PresetDefault, 75)
	if err != nil {
		log.Fatalln(err)
	}

	if err := webp.Encode(&buff, img, options); err != nil {
		log.Fatalln(err)
	}
	return buff
}

func work(str ...string) <-chan string {
	output := make(chan string)

	go func() {
		for _, val := range str {
			output <- val
		}
		close(output)
	}()

	return output
}

func pipeline[I any, O any](quit <-chan struct{}, input <-chan I, process func(I) O) <-chan O {
	out := make(chan O)
	// <-quit
	go func() {
		defer close(out)
		for val := range input {
			select {
			case out <- process(val):
			case <-quit:
				return
			}
		}
	}()

	fmt.Println("test")

	return out
}

func fanIn[T any](channels ...<-chan T) chan T {
	out := make(chan T)

	var wg sync.WaitGroup

	wg.Add(len(channels))
	for _, ch := range channels {
		go func(in <-chan T) {
			defer wg.Done()
			for i := range in {
				out <- i
			}
		}(ch)
	}
	go func() {
		wg.Wait()
		close(out)
	}()
	return out
}

